    false,nt"url": null,nt"notes": "Large scale geologic features suggest that
    a geothermal resource may be found near Columbus, New Mexico.  Columbus is located
    at the western edge of a filled basin at least 1400 meters deep in a region of high
    heat flow, greater than 3 HFU.  The area lies approximately 150 km south of Faywood
    Hot Springs, and is bracketed to the northeast and southwest by swarms of cinder
    cones, all of which suggest geothermal activity.  PDF document, 26 pages, 739 KB
